jQuery(document).ready(function($){
  $(".week_card").click(function(){
    $("#"+$(this).attr("data-id")).slideToggle("slow");
  });
  if($('.days-bar__slide').length > 0){
    var parent_middle = $('.days-bar__slide').outerWidth() / 2;
    var active_middle = $(".days-bar__btn--active").outerWidth() / 2;
    var scroll_val = $(".days-bar__btn--active").offset().left - parent_middle + active_middle;
    $('.days-bar__slide').animate({
      scrollLeft: scroll_val
    }, 100);
  }
});
